import Navbar from "./Components/Navbar/Navbar";
import Home from "./Components/Home/Home";
import "./App.css";
import Login from "./Components/Login";
import { BrowserRouter, Routes, Link, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />

          {/* <Home/> */}
          <Login />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
